INSERT INTO `reviews` VALUES (7, 'Good!!!!!!!!!!!!!!!!!!!!!!!!!!!', '2024-07-05 15:36:05.422000', 5, 1, '2024-07-05 15:36:05.422000', 11, 2, 2);
INSERT INTO `reviews` VALUES (8, 'I recently completed a marketing course, and it was an incredibly enriching experience. The course provided a comprehensive overview of key marketing principles, including market research, branding, digital marketing strategies, and consumer behavior. The instructors were experienced industry professionals who shared valuable insights and practical knowledge. The course also featured engaging case studies and real-world examples, which helped in understanding the application of theoretical concepts. Interactive assignments and group projects fostered collaboration and hands-on learning. Overall, this course has significantly enhanced my marketing skills and I highly recommend it to anyone looking to excel in the field of marketing.', '2024-07-10 14:23:39.027000', 5, 1, '2024-07-10 14:23:39.027000', 12, 16, 1);
INSERT INTO `reviews` VALUES (9, 'I recently completed an online Java course, and it was a fantastic learning experience. The course covered all fundamental aspects of Java programming, from basic syntax to advanced topics like multithreading and collections. The instructors were knowledgeable and provided clear explanations, making complex concepts easier to grasp. Additionally, the course included numerous hands-on projects and exercises, which helped reinforce the material and allowed me to apply what I learned in real-world scenarios. The interactive coding challenges and quizzes also kept me engaged throughout the course. Overall, I highly recommend this Java course to anyone looking to build a strong foundation in Java programming.', '2024-07-22 18:10:19.120000', 5, 1, '2024-07-22 18:10:19.120000', 12, 2, 1);
INSERT INTO `reviews` VALUES (10, 'I recently completed an online Java course, and it was a fantastic learning experience. The course covered all fundamental aspects of Java programming, from basic syntax to advanced topics like multithreading and collections. The instructors were knowledgeable and provided clear explanations, making complex concepts easier to grasp. Additionally, the course included numerous hands-on projects and exercises, which helped reinforce the material and allowed me to apply what I learned in real-world scenarios. The interactive coding challenges and quizzes also kept me engaged throughout the course. Overall, I highly recommend this Java course to anyone looking to build a strong foundation in Java programming.', '2024-07-22 19:52:23.527000', 4, 1, '2024-07-22 19:52:23.527000', 24, 15, 2);

